import React from 'react';
import './styles/Footer.css';

import { NavLink } from "react-router-dom";

function Footer({ onLoginClick, onSignupClick, userRole }) {
  // Conditionally render footer content based on userRole
  const renderFooterContent = () => {
    if (userRole === 'COACH') {
      return (
        <>
          {/* <NavLink activeClassName="active" to="/MyWorkout">My Workout</NavLink >
          <NavLink activeClassName="active" to="/Activity">Activity</NavLink>
          <NavLink activeClassName="active" to="/Progress">Progress</NavLink> */}
          <div>My Clients</div>
          <div>My Workout</div>
          <div>My Coach</div>
          <div>Activity</div>
          <div>Progress</div>
          <div>Settings</div>
        </>
      );
    } else if (userRole === 'CLIENT') {
      return (
        <>
          {/* <NavLink activeClassName="active" to="/MyWorkout">My Workout</NavLink activeClassName="active">
          <NavLink activeClassName="active" to="/Activity">Activity</NavLink activeClassName="active">
          <NavLink activeClassName="active" to="/Progress">Progress</NavLink activeClassName="active"> <div>My Coach</div> */}
          <div>Activity</div>
          <div>Progress</div>
          <div>Settings</div>
        </>
      );
    } else {
      return (
        <>
          <div className="login" onClick={onLoginClick}>LOGIN</div>
          <div className="signup" onClick={onSignupClick}>SIGNUP</div>
        </>
      );
    }
  };

  return (
    <div className="footer">
      <NavLink  to="/MyWorkout" activeClassName="active">My Workout</NavLink>
      <NavLink activeClassName="active" to="/Activity">Activity</NavLink>
      <NavLink activeClassName="active" to="/Progress">Progress</NavLink>
      {renderFooterContent()}
    </div>
  );
}

export default Footer;
